        <div className="creditLinesGrantedItemLinePart creditLinesGrantedItemLinePart14">10%</div>
        <div className="creditLinesGrantedItemLinePart creditLinesGrantedItemLinePart14">50%</div>
        <div className="creditLinesGrantedItemLinePart creditLinesGrantedItemLinePart14">50%</div>
        <div className="creditLinesGrantedItemLinePart creditLinesGrantedItemLinePart14">50%</div>
        <div className="creditLinesGrantedItemLinePart creditLinesGrantedItemLinePart14">ETH</div>
      </div>
    </React.Fragment>
  );
}
